Bring your tents and get ready to make s'mores with your youth group
[
[
[
[
Table of Contents
]
[
]
]
]
]
[
]
[
Features
]
[
[
[
]
]
]
Youth group camping is for tents only
Sites range in size and can accommodate groups as small as 12 to as large as 50
Youth group sites usually have potable water, picnic tables, and fire pits
They are also usually close to clean restrooms and showers
Checkout time is noon for all locations
[
Cost
]
[
[
[
]
]
]
$2 per person, per night. Minimum of 12 people. Reservations are required.
[
Reservations
]
[
[
[
]
]
]
Call the park to learn more and book your site. Must provide proof that you are affiliated with an organized youth group. Checkout time is noon for all locations.
[
Locations
]
[
[
[
]
]
]
[
Alderman's Ford Conservation Park
]
To make a reservation, call the park directly at (813) 757-3801
Camping cost $2 per person with a minimum of $24
There are 2 sites:
Site one has a maximum of 35 people
Site two has a maximum of 50 people
[
Lake Park
]
To make a reservation, call the park directly at (813) 264-3806
Camping cost $2 per person with a minimum of $24
There are 2 sites:
Site one has a maximum of 50 people
Site two has a maximum of 25 people
[
Lithia Springs Conservation Park
]
To make a reservation, call the park directly at (813) 744-5572
Camping cost $2 per person with a minimum of $24
There are 2 sites:
Site one has a maximum of 50 people
Site two has a maximum of 325 people
[
Upper Tampa Bay Conservation Park
]
To make a reservation, call the park directly at (813) 855-1765
Camping cost $2 per person with a minimum of $24
There are 2 sites:
Site one has a maximum of 40 people
Site two has a maximum of 30 people
